import React from 'react'

const Result = (props: any) => {
    const isCorrect: boolean = props.correctAnswers.includes(props.id);
    return <div className={props.isEmpty ? "hidden" : props.isCorrect ? "result-container correct" : "result-container false" }>
        <i className="material-symbols-outlined">{isCorrect ? "toys_and_games" : "check"}</i>
        <p>{isCorrect ? "toys_and_games" : "check"}</p>
    </div>
}

export default Result;
